      'AGENT_COLLABORATION': 'Â≠êÊô∫ËÉΩ‰ΩìÂçè‰Ωú‰∫§ÊµÅ',
      'TASK_EXECUTION': 'Â≠êÊô∫ËÉΩ‰ΩìÊâßË°å‰ªªÂä°',
      'ISSUE_REPORTING': 'Êô∫ËÉΩ‰ΩìÊ±áÊä•ÈóÆÈ¢ò',
