      'TASK_REDISTRIBUTION': 'MasterÊô∫ËÉΩ‰ΩìÈáçÊñ∞ÂàÜÈÖç‰ªªÂä°',
      'FINAL_EXECUTION': 'Â≠êÊô∫ËÉΩ‰ΩìÂÆåÊàêÊúÄÁªà‰ªªÂä°',
      'FINAL_REVIEW': 'MasterÊô∫ËÉΩ‰ΩìÊÄªÁªìÂ§çÁõò'
    };
    return titles[phase] || phase;
  };

  const getWorkflowStepDescription = (phase) => {
    const descriptions = {
      'LEADER_RECEIVE_TASK': 'MasterÊô∫ËÉΩ‰Ωì‰∫ÆËµ∑ÔºåÂºÄÂßãÊé•Êî∂Áî®Êà∑‰ªªÂä°',
      'MEETING_ANALYSIS': 'MasterÊô∫ËÉΩ‰Ωì‰ΩøÁî®LLMÂàÜÊûê‰ªªÂä°ÔºåÂà∂ÂÆöÂçè‰ΩúÁ≠ñÁï•',
      'TASK_DISTRIBUTION': 'MasterÊô∫ËÉΩ‰ΩìÂêëÂ≠êÊô∫ËÉΩ‰ΩìÂàÜÈÖçÂÖ∑‰Ωì‰ªªÂä°',
      'AGENT_COLLABORATION': 'Â≠êÊô∫ËÉΩ‰ΩìÂºÄÂßãÂçè‰Ωú‰∫§ÊµÅÔºåÂÖ±‰∫´‰ø°ÊÅØ',
      'TASK_EXECUTION': 'Â≠êÊô∫ËÉΩ‰ΩìÂºÄÂßãÊâßË°åÂÖ∑‰Ωì‰ªªÂä°',
      'ISSUE_REPORTING': 'Êô∫ËÉΩ‰ΩìÂêëMasterÊô∫ËÉΩ‰ΩìÊ±áÊä•ÈóÆÈ¢ò',
      'ISSUE_RESOLUTION': 'MasterÊô∫ËÉΩ‰ΩìÂàÜÊûêÈóÆÈ¢òÔºåÂà∂ÂÆöËß£ÂÜ≥ÊñπÊ°à',
      'TASK_REDISTRIBUTION': 'MasterÊô∫ËÉΩ‰ΩìÈáçÊñ∞ÂàÜÈÖç‰ªªÂä°ÔºåË∞ÉÊï¥ÊâßË°åÁ≠ñÁï•',
      'FINAL_EXECUTION': 'Â≠êÊô∫ËÉΩ‰ΩìÂçè‰ΩúÂÆåÊàêÊúÄÁªà‰ªªÂä°',
      'FINAL_REVIEW': 'MasterÊô∫ËÉΩ‰ΩìÂπøÊí≠ÊúÄÁªàÁªìÊûúÔºåËøõË°åÂ§çÁõòÊÄªÁªì'
    };
    return descriptions[phase] || 'ÊâßË°åÂ∑•‰ΩúÊµÅÊ≠•È™§';
  };

  const workflowSteps = interactionHistory.filter(item => item.type === 'workflow_step');

  return (
    <div className="workflow-executor">
      <div className="executor-header">
        <h3 className="executor-title">üöÄ Multi-Agent DSL Â∑•‰ΩúÊµÅÊâßË°å</h3>
        <div className="executor-subtitle">ÂÆûÊó∂Â±ïÁ§∫Â§öÊô∫ËÉΩ‰ΩìÂçè‰ΩúËøáÁ®ã</div>
      </div>

      {isLoading && (
        <div className="loading-overlay">
          <div className="loading-content">
            <div className="loading-spinner-large"></div>
            <p className="loading-text">Ê≠£Âú®Â§ÑÁêÜ‰ªªÂä°...</p>
            <p className="loading-subtext">Multi-Agent DSL Framework Ê≠£Âú®ÂçèË∞ÉÊô∫ËÉΩ‰ΩìÊâßË°å</p>
          </div>
        </div>
